import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<div class="${classMap(context.classes)}" @click="${context._headerClick}" @keydown="${context._headerKeydown}" @keyup="${context._headerKeyup}" role="${ifDefined(context.ariaHeaderRole)}" aria-labelledby="${ifDefined(context.ariaLabelledByHeader)}" aria-level="${ifDefined(context.ariaLevel)}" aria-roledescription="${ifDefined(context.ariaCardHeaderRoleDescription)}" tabindex="0" id="${ifDefined(context._id)}--header">${ context.hasAvatar ? block1(context) : undefined }<div class="ui5-card-header-text">${ context.titleText ? block2(context) : undefined }${ context.subtitleText ? block3(context) : undefined }</div>${ context.hasAction ? block4(context) : block5(context) }</div>`; };
const block1 = (context) => { return html`<div id="${ifDefined(context._id)}-avatar" class="ui5-card-header-avatar" aria-label="${ifDefined(context.ariaCardAvatarLabel)}"><slot name="avatar"></slot></div>`; };
const block2 = (context) => { return html`<div id="${ifDefined(context._id)}-title" class="ui5-card-header-title" part="title">${ifDefined(context.titleText)}</div>`; };
const block3 = (context) => { return html`<div id="${ifDefined(context._id)}-subtitle" class="ui5-card-header-subtitle" part="subtitle">${ifDefined(context.subtitleText)}</div>`; };
const block4 = (context) => { return html`<slot name="action"></slot>`; };
const block5 = (context) => { return html`<span id="${ifDefined(context._id)}-status" part="status" class="ui5-card-header-status">${ifDefined(context.status)}</span>`; };


	return block0(context);
};

export default main;
